import React, {useState, useEffect} from "react";

function Fetch(){
    const [clients, setClients] = useState([])
    const [artists, setArtists] = useState([])
    const [shops, setShops] = useState([])

    useEffect(() => {
        fetch('/clients')
            .then((resp) => resp.json())
            .then(setClients)
    }, [])

    useEffect(() => {
        fetch('/artists')
            .then((resp) => resp.json())
            .then(setArtists)
    }, [])

    useEffect(() => {
        fetch('/shops')
            .then((resp) => resp.json())
            .then(setShops)
    }, [])

    return <></>
}

export default {clients, artists, shops}
